window.bookSummaryJSON = "<p><i>Booklist</i> calls the world of Hugo Award winner Elizabeth Bear’s spellbinding Jacob’s Ladder series “magnificently populated, well worth visiting.” Here the trilogy that began with <i>Dust and Chill</i> draws to its stunning conclusion. The passengers of the generation spaceship <i>Jacob’s Ladder</i> have found a new home at last. But the planet Grail is already inhabited - and its population of genetically engineered humans has no intention of sharing the world.</p>"; 
